import React, { Component } from 'react'
import axios from 'axios'

class Profile extends Component {
  state = {
    users: [],
  }

  componentDidMount() {
    axios.get('/users').then((res) => {
      const users = res.data
      this.setState({ users })
    })
  }

  render() {
    return (
      <ul>
        {this.state.users.map((users) => (
          <li>{users.name}</li>
        ))}
      </ul>
    )
  }
}

export default Profile
